/**
 * Compiles a query builder instance into a string ready for execution
 */
export default class Compiler {
    compileDelete(query: any): string;
    compileInsert(query: any, rows: any): string;
    compileSelect(query: any, count?: boolean): string;
    compileUpdate(query: any, updates: object): string;
    private compileWheres;
}
